import React from "react";
import Styles from "./MasonryGridLayout.module.css";
import { Button } from "react-bootstrap";

import MyCard from "./myCard";

export default function MasonryGridLayout() {
	const arr = [];
	const makeCards = (n) => {
		for (let i = 0; i < n; i++) {
			arr.push(
				<MyCard
					change={false}
					username="Romina"
					quote="I'm selfish, impatient and a little insecure. I make mistakes, I am out of control and at times hard to handle. But if you can't handle me at my worst, then you sure as hell don't deserve me at my best.”"
					tag="Love"
					quoteTittle="Love for all"
				></MyCard>
			);
		}
	};
	makeCards(5);
	return (
		<div className={Styles.container}>
			<div className={Styles.Wrapper}>
				<MyCard
					change={false}
					username="Romina"
					quote="“I love you, not only for what you are, but for what I am when I am with you.”"
					tag="Love"
					quoteTittle="Love for all"
				></MyCard>
				<MyCard
					change={false}
					username="Romina"
					quote="“Love is when the other person’s happiness is more important than your own.”"
					tag="Love"
					quoteTittle="Love for all"
				></MyCard>
				<MyCard
					change={false}
					username="Romina"
					quote="“Love is the crowning grace of humanity, the holiest right of the soul, the golden link which binds us.”"
					tag="Love"
					quoteTittle="Love for all"
				></MyCard>
				<MyCard
					change={false}
					username="Romina"
					quote="I'm selfish, impatient and a little insecure. I make mistakes, I am out of control and at times hard to handle. But if you can't handle me at my worst, then you sure as hell don't deserve me at my best.”"
					tag="Love"
					quoteTittle="Love for all"
				></MyCard>
				<MyCard
					change={false}
					username="Romina"
					quote="I'm selfish, impatient and a little insecure. I make mistakes, I am out of control and at times hard to handle. But if you can't handle me at my worst, then you sure as hell don't deserve me at my best.”"
					tag="Love"
					quoteTittle="Love for all"
				></MyCard>
			</div>
		</div>
	);
}
